INSERT INTO `blogs` VALUES (1,'Property Managers must implement continuing Covid Safety Protocols in the properties.','<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"blob:http://thepropertymanager.online/b12d5c65-91a3-4c30-9da2-a1908863438a\" width=\"940\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\">Temperature&nbsp;Scanning&nbsp;on&nbsp;all&nbsp;entrances.</li>\r\n	<li style=\"text-align: justify;\">Disinfection&nbsp;of&nbsp;incoming&nbsp;vehicles.</li>\r\n	<li style=\"text-align: justify;\">Disinfection&nbsp;mats&nbsp;at&nbsp;the&nbsp;entrances.</li>\r\n	<li style=\"text-align: justify;\">Health&nbsp;declaration&nbsp;checklist&nbsp;for&nbsp;returning&nbsp;tenants&nbsp;and&nbsp;employees.</li>\r\n	<li style=\"text-align: justify;\">Health&nbsp;questionnaires&nbsp;for&nbsp;visitors.</li>\r\n	<li style=\"text-align: justify;\">Deep&nbsp;cleaning&nbsp;and&nbsp;sanitation&nbsp;on&nbsp;common&nbsp;areas.</li>\r\n	<li style=\"text-align: justify;\">Social&nbsp;distancing&nbsp;marking&nbsp;on&nbsp;common&nbsp;areas.</li>\r\n	<li style=\"text-align: justify;\">Reminders&nbsp;on&nbsp;Using&nbsp;Face&nbsp;Mask.</li>\r\n	<li style=\"text-align: justify;\">Prescribed&nbsp;PPE&nbsp;for&nbsp;building&nbsp;staff.</li>\r\n	<li style=\"text-align: justify;\">&nbsp;Contact&nbsp;less&nbsp;policy&nbsp;thru&nbsp;cashless&nbsp;transactions&nbsp;and&nbsp;email&nbsp;approvals&nbsp;on&nbsp;work&nbsp;permits&nbsp;or&nbsp;gate&nbsp;passes,&nbsp;etc.</li>\r\n</ol>','Tenants',13,NULL,1,NULL,NULL,'2020-10-07 09:14:02',NULL),(2,'Being Customer Centric.','<ol>\r\n	<li>Differentiation.&nbsp;</li>\r\n</ol>\r\n\r\n<blockquote>\r\n<p>How&nbsp;we&nbsp;differentiate&nbsp;ourselves&nbsp;in&nbsp;a&nbsp;sea&nbsp;of&nbsp;sameness&nbsp;will&nbsp;make&nbsp;us&nbsp;stand&nbsp;out&nbsp;in&nbsp;the&nbsp;market.&nbsp; Our&nbsp;products&nbsp;or&nbsp;services&nbsp;may&nbsp;be&nbsp;the&nbsp;same&nbsp;as&nbsp;our&nbsp;competitors&nbsp;but&nbsp;the&nbsp;customer&nbsp;experience&nbsp;is&nbsp;different&nbsp;each&nbsp;time. Today&#39;s&nbsp;economy&nbsp;and&nbsp;market&nbsp;in&nbsp;a&nbsp;pandemic&nbsp;may&nbsp;not&nbsp;be&nbsp;something&nbsp;that&nbsp;we&nbsp;can&nbsp;control&nbsp;but&nbsp;the&nbsp;experience&nbsp;we&nbsp;give&nbsp;to&nbsp;our&nbsp;customers&nbsp;is&nbsp;directly&nbsp;impacted&nbsp;by&nbsp;us.&nbsp;The&nbsp;ability&nbsp;to&nbsp;capture&nbsp;that&nbsp;customer&nbsp;is&nbsp;in&nbsp;how&nbsp;we&nbsp;provide&nbsp;that&nbsp;experience&nbsp;for&nbsp;our&nbsp;customer&nbsp;that&nbsp;differentiates&nbsp;us&nbsp;from&nbsp;others.&nbsp;</p>\r\n</blockquote>\r\n\r\n<ol>\r\n	<li>&nbsp;Add&nbsp;Value</li>\r\n</ol>\r\n\r\n<blockquote>\r\n<p>Doing&nbsp;a&nbsp;little&nbsp;bit&nbsp;extra&nbsp;for&nbsp;the&nbsp;customer&nbsp;will&nbsp;be&nbsp;the&nbsp;decisive&nbsp;factor&nbsp;in&nbsp;the&nbsp;perspective&nbsp;of&nbsp;the customer&nbsp;that&nbsp;we&nbsp;serve. It&nbsp;does&nbsp;not&nbsp;have&nbsp;to&nbsp;take&nbsp;too&nbsp;much&nbsp;or&nbsp;cost&nbsp;too&nbsp;much.&nbsp;It&nbsp;could&nbsp;be&nbsp;a&nbsp;warm&nbsp;greeting&nbsp;and&nbsp;a&nbsp;small&nbsp;gift.&nbsp;Research&nbsp;shows&nbsp;that&nbsp;a&nbsp;warm&nbsp;greeting&nbsp;and&nbsp;a&nbsp;small&nbsp;gift&nbsp;has&nbsp;a&nbsp;46%&nbsp;increase&nbsp;in&nbsp;the&nbsp;revenue&nbsp;the&nbsp;customer&nbsp;brings.</p>\r\n</blockquote>\r\n\r\n<ol>\r\n	<li>Reduce&nbsp;maintenance.&nbsp;&nbsp;</li>\r\n</ol>\r\n\r\n<blockquote>\r\n<p>&nbsp;Immediate&nbsp;improvement&nbsp;of&nbsp;the&nbsp;experience&nbsp;we&nbsp;provide&nbsp;the&nbsp;customer&nbsp;can&nbsp;be&nbsp;immediately&nbsp;achieved&nbsp;by&nbsp;reducing&nbsp;waiting&nbsp;time,&nbsp;being&nbsp;responsive,&nbsp;and&nbsp;being&nbsp;accessible.&nbsp;It&nbsp;is&nbsp;not&nbsp;a&nbsp;one&nbsp;time&nbsp;experience&nbsp;but&nbsp;must&nbsp;be&nbsp;consistent.&nbsp;It&nbsp;has&nbsp;to&nbsp;be&nbsp;a&nbsp;part&nbsp;of&nbsp;our&nbsp;DNA,&nbsp;our&nbsp;purpose,&nbsp;to&nbsp;make&nbsp;it&nbsp;easier&nbsp;for&nbsp;our&nbsp;customers</p>\r\n\r\n<p>&nbsp;</p>\r\n</blockquote>\r\n\r\n<p><strong>Technology&nbsp;can&nbsp;help&nbsp;us&nbsp;be&nbsp;customercentric&nbsp;by&nbsp;automating&nbsp;processes,&nbsp;we&nbsp;reduce&nbsp;waiting&nbsp;and&nbsp;be&nbsp;more&nbsp;responsive&nbsp;to&nbsp;our&nbsp;customers&nbsp;needs.&nbsp;Data&nbsp;gives&nbsp;us&nbsp;the&nbsp;information&nbsp;that&nbsp;we&nbsp;need&nbsp;to&nbsp;cater&nbsp;to&nbsp;the&nbsp;special&nbsp;needs&nbsp;of&nbsp;our&nbsp;customers&nbsp;and&nbsp;provides&nbsp;valuable&nbsp;insights&nbsp;that&nbsp;can&nbsp;help&nbsp;us&nbsp;differentiate&nbsp;ourselves,&nbsp;to&nbsp;add&nbsp;value&nbsp;to&nbsp;our&nbsp;services,&nbsp;&nbsp;and&nbsp;reduce&nbsp;maintenance.</strong></p>','Property Management',13,NULL,1,NULL,NULL,'2020-10-07 10:30:23',NULL),(3,'Guidelines on Concessions on Residential and Commercial Rents During Covid 19 in the Philippines.','<ul>\r\n	<li style=\"text-align: justify;\">&nbsp;&nbsp;Republic Act 11469, known as the Bayanihan to Heal as One Act, declared as a policy during the COVID 19 pandemic to provide for a minimum thirty (30) day grace period on residential and commercial rents for MSMEs falling due within the period of the Enhance Community Quarantine (ECQ), Modified Enhanced Community Quarantine (MECQ), General Community Quarantine (GCQ) or until such a time that the community quarantine is lifted, without incurring interests, penalties, fees, and other charges.&nbsp;</li>\r\n	<li>\r\n	<p style=\"text-align:justify\">&nbsp;&nbsp;The&nbsp;grant&nbsp;for&nbsp;a&nbsp;minimum&nbsp;30&nbsp;day&nbsp;grace&nbsp;period&nbsp;shall&nbsp;commence&nbsp;from&nbsp;the&nbsp;lifting&nbsp;of&nbsp;the&nbsp;covered&nbsp;community&nbsp;quarantine&nbsp;or&nbsp;from&nbsp;the&nbsp;date&nbsp;that&nbsp;the&nbsp;tenant&nbsp;is&nbsp;allowed&nbsp;to&nbsp;resume&nbsp;employment&nbsp;or&nbsp;business&nbsp;operation,&nbsp;whichever&nbsp;comes&nbsp;first,&nbsp;without&nbsp;incurring&nbsp;interests, penalties,&nbsp;fees,&nbsp;and&nbsp;other&nbsp;charges.</p>\r\n	</li>\r\n	<li>\r\n	<p style=\"text-align:justify\">&nbsp;The&nbsp;grace&nbsp;period&nbsp;may&nbsp;be&nbsp;availed&nbsp;of&nbsp;the&nbsp;residential&nbsp;or&nbsp;commercial&nbsp;lessees&nbsp;who&nbsp;have&nbsp;lost&nbsp;their&nbsp;income&nbsp;during&nbsp;any of&nbsp;the&nbsp;community&nbsp;quarantines,&nbsp;or&nbsp;whose&nbsp;employer&nbsp;or&nbsp;businesses&nbsp;where&nbsp;not&nbsp;allowed&nbsp;to&nbsp;operate&nbsp;by&nbsp;law/regulations/ordinance relevant&nbsp;to&nbsp;any&nbsp;covered&nbsp;community&nbsp;quarantine.&nbsp;The&nbsp;commencement&nbsp;of&nbsp;the&nbsp;grace&nbsp;period&nbsp;shall&nbsp;be&nbsp;from&nbsp;the&nbsp;date&nbsp;that&nbsp;the&nbsp;employer&nbsp;or&nbsp;business&nbsp; was&nbsp;allowed&nbsp;to&nbsp;resume&nbsp;operations&nbsp;regardless&nbsp;of&nbsp;whether&nbsp;or&nbsp;not&nbsp;the&nbsp;lessee&nbsp;opts&nbsp;to&nbsp;go&nbsp;back&nbsp;to&nbsp;work&nbsp;or&nbsp;resume&nbsp;business&nbsp;operations.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p style=\"text-align:justify\">&nbsp;Cumulative&nbsp;amounts&nbsp;of&nbsp;rents&nbsp;falling&nbsp;due&nbsp;within&nbsp;any&nbsp;of&nbsp;the&nbsp;covered&nbsp;community&nbsp;quarantine,&nbsp;shall&nbsp;be&nbsp;equally&nbsp;amortized&nbsp;in&nbsp;six&nbsp;(6)&nbsp;months&nbsp;following&nbsp; the&nbsp;end&nbsp;of&nbsp;the&nbsp;30&nbsp;day&nbsp;minimum&nbsp;grace&nbsp;period,&nbsp;without&nbsp;interests,&nbsp;penalties,&nbsp;fees&nbsp;and&nbsp;other&nbsp;charges,&nbsp;which&nbsp;amount&nbsp;shall&nbsp;be&nbsp;added&nbsp;to&nbsp;the&nbsp;monthly&nbsp; rent&nbsp;due.&nbsp;To&nbsp;avail&nbsp;of&nbsp;the&nbsp;6-month&nbsp;concession,&nbsp;the&nbsp;lessee&nbsp;shall&nbsp;provide&nbsp;the&nbsp;lessor&nbsp;a&nbsp;signed&nbsp; Promissory&nbsp;Note&nbsp;of&nbsp;letter,&nbsp;undertaking&nbsp;to&nbsp;pay&nbsp;the&nbsp;deferred&nbsp;rent/s&nbsp;in&nbsp;accordance&nbsp;herewith,&nbsp;and&nbsp;failure&nbsp;thereof&nbsp;shall&nbsp;make&nbsp;such&nbsp;deferred&nbsp;rents&nbsp;due&nbsp; and&nbsp;demandable&nbsp;immediately&nbsp;following&nbsp;the&nbsp;end&nbsp;of&nbsp;the&nbsp;minimum&nbsp;30&nbsp;days&nbsp;grace&nbsp;period.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p style=\"text-align:justify\">&nbsp;Lessors&nbsp;are&nbsp;not&nbsp;obliged&nbsp;to&nbsp;refund&nbsp;residential&nbsp;and&nbsp;commercial&nbsp;rents&nbsp;paid&nbsp;by&nbsp;the&nbsp;lessees&nbsp;before&nbsp;or&nbsp;during&nbsp;the&nbsp;period&nbsp;of ECQ&nbsp;or&nbsp;any&nbsp;version&nbsp;thereof.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p style=\"text-align:justify\">&nbsp;&nbsp;Lessors&nbsp;of&nbsp;commercial&nbsp;rent&nbsp;for&nbsp;MSMEs&nbsp;who&nbsp;wish&nbsp;to&nbsp;extend&nbsp;greater&nbsp;generosity&nbsp;may&nbsp;totally&nbsp;or&nbsp;partially&nbsp;waive&nbsp;the&nbsp;commercial&nbsp;rents&nbsp;that&nbsp;are&nbsp;falling&nbsp;due&nbsp;during&nbsp;the&nbsp;covered&nbsp;community&nbsp;quarantine;&nbsp;grant&nbsp;reprieve&nbsp;or&nbsp;discounted&nbsp;amount&nbsp;of&nbsp;commercial&nbsp;rents&nbsp;due&nbsp;after&nbsp;the&nbsp;covered&nbsp;community&nbsp;quarantine;&nbsp;open&nbsp;for&nbsp;renegotiation&nbsp;the&nbsp;Lease&nbsp;Term&nbsp;Agreements&nbsp;with&nbsp;the&nbsp;lessees;&nbsp;or&nbsp;use&nbsp;other&nbsp;recourse&nbsp;to&nbsp;mitigate&nbsp;the&nbsp;impact&nbsp;of&nbsp;a&nbsp;covered&nbsp;community&nbsp;quarantine&nbsp;to&nbsp;the&nbsp;MSMEs.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p style=\"text-align:justify\">&nbsp;No&nbsp;eviction&nbsp;for&nbsp;failure&nbsp;to&nbsp;pay&nbsp;the&nbsp;residential&nbsp;or&nbsp;commercial&nbsp;rent&nbsp;due&nbsp;may&nbsp;be&nbsp;enforced&nbsp;from&nbsp;May&nbsp;17,&nbsp;2020&nbsp;when&nbsp;ECQ&nbsp;took&nbsp;effect&nbsp;until&nbsp;the&nbsp;end&nbsp;of&nbsp;the&nbsp;grace&nbsp;period&nbsp;granted&nbsp;by&nbsp;the&nbsp;lessor&nbsp;to&nbsp;a&nbsp;lessee.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p style=\"text-align:justify\">Lessors&nbsp;may&nbsp;be&nbsp;held&nbsp;criminally,&nbsp;civilly,&nbsp;or&nbsp;administratively&nbsp;liable&nbsp;for&nbsp;failure&nbsp;to&nbsp;abide&nbsp;by&nbsp;relevant&nbsp;laws,&nbsp;regulations&nbsp;and/&nbsp;or&nbsp;ordinances.&nbsp;The&nbsp;same&nbsp;applies&nbsp;to&nbsp;lessees&nbsp; who&nbsp;fail&nbsp;to&nbsp;pay&nbsp;their&nbsp;obligations&nbsp;and&nbsp;abide&nbsp;by&nbsp;the&nbsp;terms&nbsp;of&nbsp;their&nbsp;promissory&nbsp;note.</p>\r\n	</li>\r\n</ul>','Real Estate Trends',13,NULL,1,NULL,NULL,'2020-10-07 10:37:56',NULL),(4,'Navigating the New Normal in Property Management.','<blockquote>\r\n<p style=\"text-align:justify\">&nbsp;Never&nbsp;let&nbsp;a&nbsp;crisis&nbsp;go&nbsp;to&nbsp;waste.&nbsp;In&nbsp;a&nbsp;pandemic,&nbsp;there&nbsp;are&nbsp;opportunities.&nbsp;We&nbsp;need&nbsp;to&nbsp;take&nbsp;advantage&nbsp;of&nbsp;this&nbsp;pandemic&nbsp;to&nbsp;become&nbsp;innovative,&nbsp;to&nbsp;experiment,&nbsp;and&nbsp;to&nbsp;optimize.&nbsp;This&nbsp;health&nbsp;crisis&nbsp;allows&nbsp;us&nbsp;the&nbsp;time&nbsp;in&nbsp;the&nbsp;property&nbsp;management&nbsp;industry&nbsp;to&nbsp;digitally&nbsp;transform&nbsp;our&nbsp;businesses&nbsp;and&nbsp;to&nbsp;use&nbsp;technology&nbsp;as a&nbsp;strategy&nbsp;to&nbsp;expand&nbsp;our&nbsp;business&nbsp;and&nbsp;increase&nbsp;the&nbsp;number&nbsp;of&nbsp;properties&nbsp;managed&nbsp;even&nbsp;during&nbsp;any&nbsp;crisis.&nbsp;A&nbsp;Property&nbsp;Management&nbsp;System&nbsp;is&nbsp;essential&nbsp;especially&nbsp;during&nbsp;a&nbsp;crisis,&nbsp;when&nbsp;we&nbsp;have&nbsp;to&nbsp;manage&nbsp;our&nbsp;properties&nbsp;remotely.&nbsp;Our&nbsp;customers&nbsp;may&nbsp;be&nbsp;the&nbsp;same&nbsp;but&nbsp;their&nbsp;behaviors&nbsp;and&nbsp;their&nbsp;needs&nbsp;have&nbsp;changed.</p>\r\n\r\n<p style=\"text-align:justify\">We&nbsp;need&nbsp;to&nbsp;adapt&nbsp;and&nbsp;continue&nbsp;to&nbsp;remain&nbsp;relevant&nbsp;in&nbsp;this&nbsp;new&nbsp;normal.&nbsp;Let&nbsp;us&nbsp;reinvent&nbsp;our&nbsp;business&nbsp;models&nbsp;to&nbsp;become&nbsp;digitally&nbsp;savvy&nbsp;property&nbsp;managers&nbsp;to&nbsp;answer&nbsp;the&nbsp;changing&nbsp;needs&nbsp;of&nbsp;our&nbsp;tenants&nbsp;and&nbsp;property&nbsp;owners.&nbsp;This&nbsp;crisis&nbsp;has&nbsp;pushed&nbsp;us&nbsp;to&nbsp;face&nbsp;our&nbsp;broken&nbsp;systems.&nbsp;We&nbsp;realize&nbsp;that&nbsp;these&nbsp;problems&nbsp;are&nbsp;existing&nbsp;even&nbsp;before&nbsp;the&nbsp;pandemic.&nbsp;Let&nbsp;us&nbsp;use&nbsp;tech&nbsp;tools&nbsp;available&nbsp;that&nbsp;will&nbsp;help&nbsp;us&nbsp;fix&nbsp;these&nbsp;problems.&nbsp;There&nbsp;are&nbsp;solutions&nbsp;out&nbsp;there&nbsp;and&nbsp;they&nbsp;require&nbsp;ingenuity,&nbsp;quality,&nbsp;technology,&nbsp;agility,&nbsp;and&nbsp;leadership.&nbsp;Furthermore,&nbsp;using&nbsp;technology&nbsp;encourages&nbsp;us&nbsp;to&nbsp;reskill&nbsp;our&nbsp;workforces.&nbsp;Our&nbsp;biggest&nbsp;asset&nbsp;goes&nbsp;home&nbsp;with&nbsp;a&nbsp;new&nbsp;thing&nbsp;they&nbsp;learned.</p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p style=\"text-align:justify\">&nbsp;A&nbsp;property&nbsp;management&nbsp;system&nbsp;is&nbsp;teaching&nbsp;our&nbsp;workforce&nbsp;new&nbsp;skills&nbsp;and&nbsp;once&nbsp;they&nbsp;appreciate&nbsp;how&nbsp;a&nbsp;system&nbsp;makes&nbsp;their&nbsp;work&nbsp;easier,&nbsp;they&nbsp;have&nbsp;more&nbsp;time&nbsp;to&nbsp;learn&nbsp;other&nbsp;skillsets.&nbsp;</p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p style=\"text-align:justify\">We&nbsp;need&nbsp;to&nbsp;evolve&nbsp;and&nbsp;update&nbsp;our&nbsp;mindsets,&nbsp;our&nbsp;knowledge,&nbsp;our&nbsp;skills,&nbsp;and&nbsp;our&nbsp;systems&nbsp;to&nbsp;navigate&nbsp;this&nbsp;new&nbsp;normal.&nbsp;</p>\r\n</blockquote>','Property Management',13,NULL,1,NULL,NULL,'2020-10-07 10:41:32',NULL);
